import React from "react";
import "./Dashboard.css";

function Dashboard() {
  return (
    <div className="dashboard-container">
      <h2>Dashboard</h2>

      <div className="stats">
        <div className="card">
          <h3>Total Crashes</h3>
          <p>1,235</p>
        </div>

        <div className="card">
          <h3>Critical Issues</h3>
          <p>42</p>
        </div>

        <div className="card">
          <h3>Resolved</h3>
          <p>980</p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
